					["custom"] = "aura_env.curmad = 0\naura_env.curzone = 0\naura_env.curemote = 0\naura_env.lastzone = 0\n\n\naura_env.madness = {\n    [\"316707\"] = 1, -- Starting Zone Promised Power\n    [\"311344\"] = 1, -- Starting Zone Bloodthirsty\n    [\"306413\"] = 1, -- Starting Zone Desynchronized \n    [\"Вы вошли в зараженную область\"] = 2, -- Entering T2\n    [\"306241\"] = 2, -- T2 Scorched Feet\n    [\"306954\"] = 2, -- T2 Dark Delusions\n    [\"311389\"] = 2, -- T2 Entomophobia\n    [\"Вы вошли в захваченную область\"] = 3, -- Entering T3\n    [\"306531\"] = 3, -- T3 Haunting Shadows\n    [\"306579\"] = 3, -- T3 Leaden Foot\n    [\"316557\"] = 3, -- T3 Split Personality\n    [\"Исследование завершено.\"] = 4,\n}\n\n\naura_env.emotes = {\n    \n    [\"Герои! Нам нужна ваша помощь\"] = 2, -- Spirits\n    [\"Не делайте этого!\"] = 2, --Dwarven\n    [\"Заложи взрывчатку в укромных местах\"] = 2, \n    [\"Похоже, все чисто.\"] = 2, \n    [\"Фальшивый сын Дуротана\"] = 3, -- Wisdom Voicelines\n    [\"Почему... не раздавились\"] = 3,\n    [\"Бездна зовет!\"] = 3,\n    [\"Что значит, Валира\"] = 3, -- Old Town\n    [\"Ключи от штаб-квартиры – у подручных Шоу\"] = 3,\n    [\"Валира! От меня не спрячешься!\"] = 3,\n    [\"Никто не скроется от Н'Зота!\"] = 3,\n    [\"Убейте орчиху, зачистите Волок!\"] = 4, -- Garona Voicelines\n    [\"У меня все было под контролем\"] = 4,\n    [\"Давай поищем выживших\"] = 4,\n    [\"Помогите! Снанг сошел с ума!\"] = 4,\n    [\"Посмотри, нет ли там кого\"]= 4,\n    [\"Плохо дело\"] = 4,\n    [\"Я... никогда... не отрекусь\"] = 4, -- Trade District\n    [\"Упрямый паладин. Свет покинул тебя\"] = 4,\n    [\"Как ты смеешь! Это моя добыча!\"] = 4,\n    [\"Благодарение Свету!\"] = 4,\n    [\"Они все сошли с ума!\"] = 4,\n    [\"Ты – всего лишь груда мяса\"] = 5, -- Rexxar voicelines\n    [\"Мои звери сожрут твою плоть\"] = 5,\n    [\"Нас больше... чем звезд на небе...\"] = 5,\n    [\"Открывайте порталы! Встречайте\"] = 5, -- Mage Quarter\n    [\"Бездна поглотит этот город!\"] = 5,\n    [\"Нас... не остановить...\"] = 5,\n    [\"Вижу, у нас гости. Приходи\"] = 5,\n    \n}\n\naura_env.index = {\n    [1] = 1,\n    [2] = 2,\n    [3] = 3,\n    [4] = 2,\n    [5] = 3,\n    \n}",
