			["displayText"] = "",
			["customText"] = "--This is the Battle for Azeroth version of the !keys WeakAura\n\n--Questions or suggestions to Luckyone on Gorgonnash EU\n\n--Luckyone#4689 on Discord (please don't add, just message me)\n\n\n",
