				},
				["init"] = {
					["custom"] = "aura_env.keystone = nil\n\n--Bag check and keystone update\naura_env.keyUpdate = function()\n    for bag = 0, NUM_BAG_SLOTS do\n        local bSlots = GetContainerNumSlots(bag)\n        for slot = 1, bSlots do\n            local icon, itemCount, locked, quality, readable, lootable, itemLink, isFiltered, noValue, itemID = GetContainerItemInfo(bag, slot)\n            if (itemID == 158923) then --Battle for Azeroth Keystone ID\n                aura_env.keystone = itemLink\n                return\n            elseif (itemID == 123456) then --Shadowlands Keystone ID\n                aura_env.keystone = itemLink\n                return\n            end\n        end\n    end\nend\n\n--Channel, get time, anti spam\naura_env.linkKey = function(channel)\n    channel = channel or \"PARTY\"\n    if channel == \"PARTY\" then\n        if aura_env.config.keysAntispam and (WeakAuras.KeysTimestampParty or 0) > (GetTime() - 90) then\n            return\n        end\n        WeakAuras.KeysTimestampParty = GetTime()\n    else\n        if aura_env.config.keysAntispam and (WeakAuras.KeysTimestampGuild or 0) > (GetTime() - 90) then\n            return\n        end\n        WeakAuras.KeysTimestampGuild = GetTime()\n    end\n    if aura_env.keystone == nil then aura_env.keyUpdate() end\n    if aura_env.keystone ~= nil then SendChatMessage(aura_env.keystone, channel) end\nend\n\n--Keystone update\naura_env.keyUpdate()\n\n--Config for custom options\nlocal config = aura_env.config\n\nlocal allTypes = {\"keysParty\", \"keysPartyleader\", \"keysGuild\", \"keysAntispam\"}\n\naura_env.types = {}\n\nfor _,type in ipairs(allTypes) do\n    if config [\"enabled\"..type] then\n        aura_env.types[type] = true\n    end\nend",
