.format(\"%02X%02X%02X\", r*255, g*255, b*255)\nend\n\n-- change colors to hex\naura_env.namecolorhex = RGBPercToHex(aura_env.config.colorgroup.namecolor[1], aura_env.config.colorgroup.namecolor[2], aura_env.config.colorgroup.namecolor[3])\naura_env.rankcolorhex = RGBPercToHex(aura_env.config.colorgroup.rankcolor[1], aura_env.config.colorgroup.rankcolor[2], aura_env.config.colorgroup.rankcolor[3])\naura_env.valuecolorhex = RGBPercToHex(aura_env.config.colorgroup.valuecolor[1], aura_env.config.colorgroup.valuecolor[2], aura_env.config.colorgroup.valuecolor[3])\naura_env.countcolorhex = RGBPercToHex(aura_env.config.colorgroup.countcolor[1], aura_env.config.colorgroup.countcolor[2], aura_env.config.colorgroup.countcolor[3])\naura_env.headertextcolorhex = RGBPercToHex(aura_env.config.colorgroup.headertextcolor[1], aura_env.config.colorgroup.headertextcolor[2], aura_env.config.colorgroup.headertextcolor[3])\naura_env.totalcorruptioncolorhex = RGBPercToHex(aura_env.config.colorgroup.totalcorruptioncolor[1], aura_env.config.colorgroup.totalcorruptioncolor[2], aura_env.config.colorgroup.totalcorruptioncolor[3])\n\n-- indent\n\naura_env.indent = function()\n    local spacestr = \"\"\n    local i = 0\n    while i < aura_env.config[\"indent\"] do\n        spacestr = spacestr .. \" \"\n        i = i + 1\n    end\n    return spacestr\nend\n\n\n\n\n",
